package com.example.smallwhite.designpatterns.chainofresponsibility.V2;import com.example.smallwhite.designpatterns.chainofresponsibility.V1.Message;/** * @author: yangqiang * @create: 2021-02-27 14:30 */public interface Filter {    /**     * 使该条责任链先执行整个请求的 责任 再从责任链的末尾执行响应责任 到第一个责任的过程     * @param req 请求     * @param resp 响应     * @param filterChain 责任链     * @return 是否继续执行责任链     * */    boolean  doFilter(Request req,Response resp,FilterChain filterChain);}